import React from 'react'
import { ThemeProvider, CSSReset, theme, Switch, Flex, useColorMode } from '@chakra-ui/core'
const Container = () => (
    <ThemeProvider theme={theme}>
        <CSSReset />
        <Flex
            // align="center"
            direction="column"
            // alignItems="center"
            justifyContent="flex-start"
            bg={bgColor[colorMode]}
            color={color[colorMode]}
            p={{ sm: 0 }}
            m={{ sm: 0 }}
        >
            <Flex
                p={{ sm: 0, md: 10 }}
                ml={{ sm: 0, md: '15%' }}
                mr={{ sm: 0, md: '15%' }}
                {...props}>
            </Flex>
        </Flex>
    </ThemeProvider>
)
export default Container

